import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import FirstPage from "./pages/Login/FirstPage";
import HomePage from "./pages/HomePage/HomePage";
import { Contact } from "./pages/Contact/contact";
import Iphones from "./pages/Categories/Iphones";
import Macbooks from "./pages/Categories/macbooks";
import Iwaches from "./pages/Categories/iwatches";

function App() {
  return (
    <div className="App">
        <Router>
          <Routes>
            <Route path="/"  element={<FirstPage />} />
            <Route path="/iphones"  element={<Iphones />} />
            <Route path="/macbooks"  element={<Macbooks />} />
            <Route path="/iwatches"  element={<Iwaches />} />
            <Route path="/contact"  element={<Contact />} />
            <Route path="/shop"  element={<HomePage />} />
          </Routes>
        </Router>
    </div>
  );
}

export default App;
